import React from 'react';

const Images = () => {

    const baseUrl = 'http://127.0.0.1:5000/analyze-mosquitoes'
    const [imageNumber, setImageNumber] = React.useState(null)

    const imageList = [1, 2, 3, 4];

    return (
       <>
        <div className='flex gap-5'>
            {imageList?.map((item) => (
                <>
                <div className='p-10 background-red' key={item} 
                    onClick={() => setImageNumber(item)}
                >{item}</div>
                </>
            ))}
        </div>
       <div className='flex justify-center items-center'>
       {imageNumber && <img src={`${baseUrl}/${imageNumber}`} wi/>}
       </div>
        </>
    );
};

export default Images;
